import React, { useState, useRef } from "react";
import {
    Container,
    Typography,
    Button,
    Grid,
} from "@mui/material";
import * as XLSX from "xlsx";
import { QRCodeSVG } from "qrcode.react";
import jsPDF from "jspdf";
import html2canvas from "html2canvas";

export default function QrGenerator() {
    const [excelData, setExcelData] = useState([]);
    const qrContainerRef = useRef(null);

    const handleFileUpload = (e) => {
        const file = e.target.files[0];
        if (!file) return;

        const reader = new FileReader();
        reader.onload = (evt) => {
            const data = new Uint8Array(evt.target.result);
            const workbook = XLSX.read(data, { type: "array" });
            const sheetName = workbook.SheetNames[0];
            const worksheet = workbook.Sheets[sheetName];
            const jsonData = XLSX.utils.sheet_to_json(worksheet);
            setExcelData(jsonData);
        };
        reader.readAsArrayBuffer(file);
    };

    const downloadQR = (id, nome, cognome) => {
        const svg = document.getElementById(id);
        if (!svg) {
            alert("QR non trovato");
            return;
        }

        const serializer = new XMLSerializer();
        const svgString = serializer.serializeToString(svg);
        const canvas = document.createElement("canvas");
        const ctx = canvas.getContext("2d");
        const img = new Image();
        const svgBlob = new Blob([svgString], { type: "image/svg+xml;charset=utf-8" });
        const url = URL.createObjectURL(svgBlob);

        img.onload = () => {
            canvas.width = img.width;
            canvas.height = img.height;
            ctx.drawImage(img, 0, 0);
            URL.revokeObjectURL(url);

            const pngUrl = canvas.toDataURL("image/png");
            const link = document.createElement("a");
            link.href = pngUrl;
            link.download = `${nome}_${cognome}.png`;
            link.click();
        };
        img.src = url;
    };

    const logoSrc ="data:image/png;base64,"
    // Conta i nomi duplicati
    const nameCounts = excelData.reduce((acc, row) => {
        const nome = row.Nome?.trim() || "";
        acc[nome] = (acc[nome] || 0) + 1;
        return acc;
    }, {});

    //  Genera PDF
    const handleDownloadPDF = async () => {
        if (!qrContainerRef.current) return;

        const pdf = new jsPDF("p", "mm", "a4");
        const qrElements = qrContainerRef.current.querySelectorAll(".qr-item");

        const pageWidth = 210;
        const pageHeight = 297;
        const margin = 10;
        const qrSize = 40;
        const textHeight = 6;
        const itemsPerRow = 4;
        const gap = 10;

        let x = margin;
        let y = margin;

        for (let i = 0; i < qrElements.length; i++) {
            const el = qrElements[i];
            const canvas = await html2canvas(el.querySelector(".qr-wrapper"), {
                scale: 2,
                useCORS: true,
            });
            const imgData = canvas.toDataURL("image/png");

            const nome = el.getAttribute("data-nome") || "";
            const cognome = el.getAttribute("data-cognome") || "";
            const label = nameCounts[nome] > 1 ? `${nome} ${cognome}` : nome;

            pdf.addImage(imgData, "PNG", x, y, qrSize, qrSize);
            pdf.setFontSize(10);
            pdf.text(label, x + qrSize / 2, y + qrSize + textHeight, { align: "center" });

            x += qrSize + gap;

            if ((i + 1) % itemsPerRow === 0) {
                x = margin;
                y += qrSize + textHeight + gap;
            }

            if (y + qrSize + textHeight > pageHeight - margin) {
                pdf.addPage();
                x = margin;
                y = margin;
            }
        }

        pdf.save("qr_codes.pdf");
    };

    return (
        <Container
            maxWidth="md"
            sx={{
                minHeight: "100vh",
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                gap: 2,
                p: 2,
            }}
        >
            <Typography variant="h5" gutterBottom>
                 Generatore QR Code
            </Typography>

            <Button variant="contained" component="label" fullWidth sx={{ mb: 2 }}>
                Carica file Excel
                <input
                    type="file"
                    hidden
                    accept=".xlsx, .xls"
                    onChange={handleFileUpload}
                />
            </Button>

            {excelData.length === 0 && <Typography>Nessun dato caricato.</Typography>}

            <Grid container spacing={2} ref={qrContainerRef} sx={{ justifyContent: "center" }}>
                {excelData.map((row, idx) => {
                    const nome = row.Nome?.trim() || "";
                    const cognome = row.Cognome?.trim() || "";
                    const qrId = `qr-${idx}`;
                    const qrValue = nameCounts[nome] > 1 ? `${nome} ${cognome}` : nome;

                    return (
                        <Grid
                            item
                            xs={3}
                            key={idx}
                            className="qr-item"
                            data-nome={nome}
                            data-cognome={cognome}
                            sx={{ textAlign: "center" }}
                        >
                            <div className="qr-wrapper">
                                <QRCodeSVG
                                    id={qrId}
                                    value={qrValue}
                                    size={100}
                                    imageSettings={{
                                        src: logoSrc,
                                        height: 25,
                                        width: 25,
                                        excavate: true,
                                    }}
                                />
                            </div>
                            <Button variant="outlined" onClick={() => downloadQR(qrId, nome, cognome)}>
                                Scarica
                            </Button>
                            <Typography variant="caption" sx={{ display: "block", mt: 1 }}>
                                {nome} {cognome}
                            </Typography>
                        </Grid>
                    );
                })}
            </Grid>

            {excelData.length > 0 && (
                <Button
                    variant="contained"
                    color="secondary"
                    onClick={handleDownloadPDF}
                    sx={{ mt: 3 }}
                >
                     Scarica PDF A4 con Nomi
                </Button>
            )}
        </Container>
    );
}
